import React, { Component, Fragment } from 'react';
import '../contract/Contact.css';
import axios from 'axios';

const MIN = 1;
const MAX = 100;
class NewContact extends Component {
  state = {
    imgUrl: '',
    isLoading: false
  };

  componentDidMount = async () => {
    const min = 1;
    const max = 100;
    const rand = MIN + Math.random() * (MAX - MIN);
    try {
      const res = await axios.get(
        `https://randomuser.me/api/portraits/men/${rand}.jpg`
      );
      console.log('RES==>>>>>>' + res);

      this.setState({
        ...this.state,
        isLoading: true
      });
    } catch (error) {
      this.setState({
        ...this.state,
        isLoading: true
      });
      console.log(error);
    }
  };
  render() {
    return (
      <Fragment>
        <div className='contact-container'>
          <div className='new-contact-container'>
            <div className='new-contact-avatar'>
              <img
                src={require('"https://randomuser.me/api/portraits/men/81.jpg"')}
              />
              <button>
                <i className='fa fa-refresh' aria-hidden='true'></i>
              </button>
            </div>
            <div className='new-contact-inputs'>
              <div className='new-contact-input'>
                <label>Name</label>
                <input />
              </div>
              <div className='new-contact-input'>
                <label>Phone</label>
                <input />
              </div>
              <div className='new-contact-input'>
                <label>Title</label>
                <input />
              </div>
            </div>
            <div className='new-contact-buttons'>
              <button className='button-ok'>Save</button>
              <button className='button-cancel'>Cancel</button>
            </div>
          </div>
        </div>
      </Fragment>
    );
  }
}

export default NewContact;
